description:
King City - Complete #1 - 12 [TOKYOPOP/Image]
By: Brandon Graham

Pete falls in love with an alien he is forced to betray. Anna watches her 
boyfriend literally turn into the drug he is addicted to and Joe has a cat 
that can become any tool or weapon. It's all just another day in King City, 
where mystery is down every alley and weirdness is crawling through your 
window. From critically acclaimed comics vet BRANDON GRAHAM comes a comic 
unlike any you have ever read!


This is on most lists of the Best Comics youre Not reading!!!


